import styled from 'styled-components';

const RecipeFilterStyled = styled.div`
	text-align: center;
`;

function RecipeFilter() {
	return <RecipeFilterStyled>RecipeFilter</RecipeFilterStyled>;
}
fetch(
	'https://spoonacular-recipe-food-nutrition-v1.p.rapidapi.com/recipes/complexSearch?query=${}&diet=${}&intolerances=${}&includeIngredients=${}&excludeIngredients=${}&instructionsRequired=${}&addRecipeInformation=true&titleMatch=${}&sort=${}&sortDirection=asc&minCarbs=${}&maxCarbs=${}&minProtein=${}&maxProtein=${}&minCalories=${}&maxCalories=${}&minFat=${}&maxFat=${}&minSaturatedFat=${}&maxSaturatedFat=${}&minSodium=${}&maxSodium=${}&minSugar=${}&maxSugar=${}&number=${}',
	options
);

export default RecipeFilter;
